import React, { Component } from "react";


class Card extends Component {
    constructor(props) {
        super(props);
    } 

  render() {
        const { name, link, likes } = this.props; 
        return (
            <div className="card">
            <img className="card__image" src={`${props.link}`} /* src={link} */ />
            <h2 className="card__place-name">{props.name}</h2>
            <button
              className="card__like-button"
              type="button"
              aria-label="поставить лайк"
            ></button>
            <span className="card__like-count">{props.likes}</span>
            <button
              className="card__remove-button"
              type="button"
              aria-label="удалить карточку"
            ></button>
            </div> 
        )
    }
}

